import react from "react";

const PricingToggle = () => {
  return (
    <div className="m-container">
      <h2>PLANS</h2>

      <style global jsx>{`
        .m-container {
          width: 100avw;
        }
        h2 {
          color: white;
          text-align: center;
        }
      `}</style>
    </div>
  );
};

export default PricingToggle;
